/* 
   C Key Logger Program
   ------------------

   This program reads user input and records every keystroke into a text file. 
   Instruct the user not to interrupt the program while in execution after keylogging has started. 

  */

#include <stdio.h>
#include <stdlib.h>
#include <ctype.h>

int main()
{

    // File pointer to store keystrokes
    FILE* logFile;

    // Buffer for user input
    char userInput;


    // Opening file for writing
    logFile = fopen("logged_keys.txt","a");

    if (logFile == NULL)
    {
         printf("Failed to open the log file! Exiting..");
         exit(0);
    }

    // Start logging keys


    printf("Press any key to log..\n");

    while (1)
    {
        userInput = getc(stdin);

        if ( userInput == EOF )
            break;

        // Store keystroke in log file
        fputc(userInput, logFile);
    }

    printf("\nKeystrokes logged to the 'logged_keys.txt' file.\n");

    // Closing log file 
    fclose(logFile);

    // All done 
    return 0;
}
